import "./card.styles.css";

const Card = ({ monster }) => {
  const { id, name, email } = monster;
  return (
    <h1>
      <div className="card-container">
        <img
          alt={`monsters ${name}`}
          src={`https://robohash.org/${id}?set=set4&size=180x180`}
        />
        <h2>{name}</h2>
        <p>{email}</p>
      </div>
    </h1>
  );
};

export default Card;
